import React from 'react';
import styled from 'styled-components';

const Nav = () => {
    return(
        <StyledNav>
            <h1><a href="#">Shenal</a></h1>
            <ul>
                <li>
                    <a href="#">1. About Me</a>
                </li>
                <li>
                    <a href="#">2. My Work</a>
                </li>
                <li>
                    <a href="#">1. Contact Me</a>
                </li>
            </ul>
        </StyledNav>
    );
};

const StyledNav = styled.nav`
    min-height: 10vh;
    display: flex;
    margin: auto;
    justify-content: space-between;
    align-items: center;
    padding: 1rem 10rem;
    background-color: #515051;
    a{
        color: white;
        text-decoration: none;
    }
    ul{
        display: flex;
        list-style: none;
    }
`;

export default Nav;
